				<div class="stl_05 stl_06">
					<div class="stl_01" style="top: 4.1741em; left:9.8722em;"><span class="stl_07">歡迎來到國立臺灣科學教育館</span><span class="stl_08">~ &nbsp;</span></div>
					<div class="stl_01" style="top: 9.6294em; left:4.3722em;"><span class="stl_09 stl_10">作為一個國立科學博物館，科教館內的常設展區內涵蓋了從生命科學<span class="stl_11">、物理、化學、數學與地球科學等豐富的展覽內容， &nbsp;</span></span></div>
					<div class="stl_01" style="top: 11.389em; left:4.3722em;"><span class="stl_09 stl_10">也不斷與國內外博物館或策展單位合作策畫展出最新的科學展覽。此<span class="stl_11">外科教館也是全國唯一一座國立科學教育中心，具備 &nbsp;</span></span></div>
					<div class="stl_01" style="top: 13.1485em; left:4.3722em;"><span class="stl_09 stl_10">科普資源中心及設備齊全的科學實驗室，並持續策畫各式各樣的科學<span class="stl_11">課程與營隊等，透過動手操作，帶給大家新鮮有趣的 &nbsp;</span></span></div>
					<div class="stl_01" style="top: 14.908em; left:4.3722em;"><span class="stl_09 stl_10">科學活動體驗，更能深植探<span class="stl_11">究科學的能力。 &nbsp;</span></span></div>
					<div class="stl_01" style="top: 17.6675em; left:4.3722em;"><span class="stl_09 stl_10">科教館期以兼顧各年齡層民眾的視角規劃各類型展覽及科學課程及各<span class="stl_11">類活動，期望全民都能學科學、玩科學，進而愛上科 &nbsp;</span></span></div>
